import { Component, Input, OnInit } from '@angular/core';

@Component({
  selector: 'app-card-car',
  templateUrl: './card-car.component.html',
  styleUrls: ['./card-car.component.scss']
})
export class CardCarComponent implements OnInit {

  @Input() nome!: string;
  @Input() marca!: string;
  @Input() modelo!: string;
  @Input() imagem!: string;
  @Input() preco!: number;
  @Input() d_alt!: string;



  constructor() { }

  ngOnInit(): void {
  }

}
